import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import Slider from 'react-input-slider';

import './App.css';

class alcSlider extends React.Component{
  constructor(props){
    super(props);
    this.state ={
      x: 5,
      y: 5,
    }
  } 
  render(){
    return(
       <div>
          ({this.state.x}, {this.state.y})
         <Slider axis="xy" x={this.state.x} y={this.state.y} onChange={this.state.x, this.state.y} />
         <Slider
         axis="x"
         x={this.state.x}
         onChange={({ x }) => this.setState(state => ({...state, x }))}
         />
         <Slider 
         axis ="y" 
         y={this.state.y} 
         onChange={({ y })=> this.setState(state=>({...state, y}))}
        />
        </div>
    );
  }
}

class App extends React.Component{
  constructor (props){
    super(props);
  }
  render(){
    const CraftSlider = new alcSlider();
    return (
    <div className="App">
      <header>
        <form>
        <li key="barName">
        <label>
          <h2>What is the Barname: </h2><br/>
          <input type = "text" id="barName"/>
        </label>
        </li>
        <li key="craft">
          <CraftSlider />        
        </li>
        <li key="wineList">

        </li>
        </form>
       </header>
    </div>
  );
}
}




export default App;
